function isRemappingEnabledForClass(node) {
    return false;
}
function isObfuscatorEnabledForClass(node) {
	var flag = false;

	if (node.superName.contains("IFMLLoadingPlugin")) {
		flag = true;
	}

	for (i = 0; i < node.methods.length; i++) {
		var method = node.methods[i];

		if (method.visibleAnnotations != null) {
			for (j = 0; j < method.visibleAnnotations.length; j++) {
				var annotation = method.visibleAnnotations[j];
				//print("ANNOTATION: " + annotation.desc)

				if (annotation != null) {
					try {
						if (annotation.desc.contains("injection") && annotation.desc.contains("spongepowered")) {
							flag = true;
						}
					} catch (e) {

					}
				}
			}
		}
	}

    	return !flag && !node.name.contains("spongepowered") && !node.name.contains("springframework");
}
